import { FaStar } from "react-icons/fa";
import './food.css';
const FoodDetails=()=>{
   return(
       <div className="fooddetails-container">
           <div className="fooddetails-image">
               <img  src="/assets/resname.png" alt="imagename"/>
           </div>
           <div>
               <h1>Ground Beef Tacos</h1>
              <p><FaStar/>4.5</p>
           </div>
           <div>
               <p>$ 9.50</p>
               <div>
                   <button>-</button>
                   <button>+</button>
               </div>
           </div>
       </div>
   )
}
export default FoodDetails;
